bool code_point_has_block(u32 code_point, Block block)
{
    auto index = static_cast<BlockUnderlyingType>(block);
    auto const& ranges = s_blocks.at(index);

    auto const* range = binary_search(ranges, code_point, nullptr, CodePointRangeComparator {});
    return range != nullptr;
}

