bool code_point_has_grapheme_break_property(u32 code_point, GraphemeBreakProperty grapheme_break_property)
{
    auto index = static_cast<GraphemeBreakPropertyUnderlyingType>(grapheme_break_property);
    auto const& ranges = s_grapheme_break_properties.at(index);

    auto const* range = binary_search(ranges, code_point, nullptr, CodePointRangeComparator {});
    return range != nullptr;
}

